import "./App.css";
import Card from "./components/Card";

const card = {
  url: "https://images.unsplash.com/photo-1453728013993-6d66e9c9123a?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTF8fGNoYW5nZXxlbnwwfHwwfHw%3D&w=1000&q=80",
  title: "My Card",
  paragraph:
    "Some quick example text to build on the card title and make up the bulk of the card's content.",
  link: "http://www.google.com",
  buttonText: "Go somewhere",
};

function App() {
  return (
    <div className="App">
      <Card Card={card.url} />
    </div>
  );
}

export default App;
